void OAIConversationsV1AddressConfigurationApi::updateConfigurationAddress(const QString &sid, const ::OpenAPI::OptionalParam<QString> &auto_creation_conversation_service_sid, const ::OpenAPI::OptionalParam<bool> &auto_creation_enabled, const ::OpenAPI::OptionalParam<QString> &auto_creation_studio_flow_sid, const ::OpenAPI::OptionalParam<qint32> &auto_creation_studio_retry_count, const ::OpenAPI::OptionalParam<OAIConfiguration_address_enum_auto_creation_type> &auto_creation_type, const ::OpenAPI::OptionalParam<QList<QString>> &auto_creation_webhook_filters, const ::OpenAPI::OptionalParam<OAIConfiguration_address_enum_method> &auto_creation_webhook_method, const ::OpenAPI::OptionalParam<QString> &auto_creation_webhook_url, const ::OpenAPI::OptionalParam<QString> &friendly_name) {
    QString fullPath = QString(_serverConfigs["updateConfigurationAddress"][_serverIndices.value("updateConfigurationAddress")].URL()+"/v1/Configuration/Addresses/{Sid}");
    
    if (!_username.isEmpty() && !_password.isEmpty()) {
        QByteArray b64;
        b64.append(_username.toUtf8() + ":" + _password.toUtf8());
        addHeaders("Authorization","Basic " + b64.toBase64());
    }
    
    {
        QString sidPathParam("{");
        sidPathParam.append("Sid").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "Sid", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"Sid"+pathSuffix : pathPrefix;
        fullPath.replace(sidPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(sid)));
    }
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "POST");

    if (auto_creation_conversation_service_sid.hasValue())
    {
        input.add_var("AutoCreation.ConversationServiceSid", ::OpenAPI::toStringValue(auto_creation_conversation_service_sid.value()));
    }
    if (auto_creation_enabled.hasValue())
    {
        input.add_var("AutoCreation.Enabled", ::OpenAPI::toStringValue(auto_creation_enabled.value()));
    }
    if (auto_creation_studio_flow_sid.hasValue())
    {
        input.add_var("AutoCreation.StudioFlowSid", ::OpenAPI::toStringValue(auto_creation_studio_flow_sid.value()));
    }
    if (auto_creation_studio_retry_count.hasValue())
    {
        input.add_var("AutoCreation.StudioRetryCount", ::OpenAPI::toStringValue(auto_creation_studio_retry_count.value()));
    }
    if (auto_creation_type.hasValue())
    {
        input.add_var("AutoCreation.Type", ::OpenAPI::toStringValue(auto_creation_type.value()));
    }
    if (auto_creation_webhook_filters.hasValue())
    {
        input.add_var("AutoCreation.WebhookFilters", ::OpenAPI::toStringValue(auto_creation_webhook_filters.value()));
    }
    if (auto_creation_webhook_method.hasValue())
    {
        input.add_var("AutoCreation.WebhookMethod", ::OpenAPI::toStringValue(auto_creation_webhook_method.value()));
    }
    if (auto_creation_webhook_url.hasValue())
    {
        input.add_var("AutoCreation.WebhookUrl", ::OpenAPI::toStringValue(auto_creation_webhook_url.value()));
    }
    if (friendly_name.hasValue())
    {
        input.add_var("FriendlyName", ::OpenAPI::toStringValue(friendly_name.value()));
    }

    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIConversationsV1AddressConfigurationApi::updateConfigurationAddressCallback);
    connect(this, &OAIConversationsV1AddressConfigurationApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    worker->execute(&input);
}

void OAIConversationsV1AddressConfigurationApi::updateConfigurationAddressCallback(OAIHttpRequestWorker *worker) {
    QString error_str = worker->error_str;
    QNetworkReply::NetworkError error_type = worker->error_type;

    if (worker->error_type != QNetworkReply::NoError) {
        error_str = QString("%1, %2").arg(worker->error_str, QString(worker->response));
    }
    OAIConversations_v1_configuration_address output(QString(worker->response));
    worker->deleteLater();

    if (worker->error_type == QNetworkReply::NoError) {
        Q_EMIT updateConfigurationAddressSignal(output);
        Q_EMIT updateConfigurationAddressSignalFull(worker, output);
    } else {

#if defined(_MSC_VER)
// For MSVC
#pragma warning(push)
#pragma warning(disable : 4996)
#elif defined(__clang__)
// For Clang
#pragma clang diagnostic push
#pragma clang diagnostic ignored "-Wdeprecated-declarations"
#elif defined(__GNUC__)
// For GCC
#pragma GCC diagnostic push
#pragma GCC diagnostic ignored "-Wdeprecated-declarations"
#endif

        Q_EMIT updateConfigurationAddressSignalE(output, error_type, error_str);
        Q_EMIT updateConfigurationAddressSignalEFull(worker, error_type, error_str);

#if defined(_MSC_VER)
#pragma warning(pop)
#elif defined(__clang__)
#pragma clang diagnostic pop
#elif defined(__GNUC__)
#pragma GCC diagnostic pop
#endif

        Q_EMIT updateConfigurationAddressSignalError(output, error_type, error_str);
        Q_EMIT updateConfigurationAddressSignalErrorFull(worker, error_type, error_str);
    }
}

void OAIConversationsV1AddressConfigurationApi::tokenAvailable(){

    oauthToken token;
    switch (_OauthMethod) {
    case 1: //implicit flow
        token = _implicitFlow.getToken(_latestScope.join(" "));
        if(token.isValid()){
            _latestInput.headers.insert("Authorization", "Bearer " + token.getToken());
            _latestWorker->execute(&_latestInput);
        }else{
            _implicitFlow.removeToken(_latestScope.join(" "));
            qDebug() << "Could not retrieve a valid token";
        }
        break;
    case 2: //authorization flow
        token = _authFlow.getToken(_latestScope.join(" "));
        if(token.isValid()){
            _latestInput.headers.insert("Authorization", "Bearer " + token.getToken());
            _latestWorker->execute(&_latestInput);
        }else{
            _authFlow.removeToken(_latestScope.join(" "));
            qDebug() << "Could not retrieve a valid token";
        }
        break;
    case 3: //client credentials flow
        token = _credentialFlow.getToken(_latestScope.join(" "));
        if(token.isValid()){
            _latestInput.headers.insert("Authorization", "Bearer " + token.getToken());
            _latestWorker->execute(&_latestInput);
        }else{
            _credentialFlow.removeToken(_latestScope.join(" "));
            qDebug() << "Could not retrieve a valid token";
        }
        break;
    case 4: //resource owner password flow
        token = _passwordFlow.getToken(_latestScope.join(" "));
        if(token.isValid()){
            _latestInput.headers.insert("Authorization", "Bearer " + token.getToken());
            _latestWorker->execute(&_latestInput);
        }else{
            _credentialFlow.removeToken(_latestScope.join(" "));
            qDebug() << "Could not retrieve a valid token";
        }
        break;
    default:
        qDebug() << "No Oauth method set!";
        break;
    }
}
